INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(1, 'Atomic Habits', 'James Clear', 13.79, 4.8, 'Self-help, Personal Development, Psychology', 'A practical guide that teaches readers how to develop good habits and eliminate bad ones through small, incremental changes.', 'In \"Atomic Habits,\" James Clear provides a comprehensive framework for understanding how habits work and how to implement effective strategies to change them. He emphasizes the power of tiny, consistent actions that compound over time, leading to significant personal transformation. Through engaging stories and actionable insights, Clear offers readers the tools they need to reshape their habits and improve their lives.', , 1, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(2, 'Harry Potter', 'J.K. Rowling', 12.99, 4.9, 'Fantasy, Fiction', 'The enchanting story of a young wizard’s journey to discover his true identity.', '“Harry Potter and the Sorcerer\'s Stone” introduces readers to Harry, a young boy who discovers he is a wizard on his 11th birthday. As he attends Hogwarts School of Witchcraft and Wizardry, he makes friends, learns magic, and uncovers the truth about his past. The book captivates readers with its imaginative world and timeless themes of friendship and bravery.', , 1, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(3, 'Nexus', 'Yuval Noah Harari', 15.99, 4.7, 'History, Technology', 'An exploration of how information networks have evolved and shaped human societies.', 'In \"Nexus,\" Yuval Noah Harari traces the history of information networks from ancient times to the present, examining how they influence communication, commerce, and culture. The book offers insights into the impact of technology on human interactions and the future of connectivity.', , 0, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(4, 'Fourth Wing', 'Rebecca Yarros', 16.99, 4.6, 'Fantasy, Romance', 'A gripping fantasy novel filled with adventure, dragons, and unexpected romance.', '“Fourth Wing” follows a young heroine who must navigate the treacherous world of dragon riders while uncovering her own strengths and desires. The narrative is rich with action, character development, and a touch of romance, making it an engaging read for fantasy lovers.', , 0, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(5, 'Good Vibes, Good Life', 'Vex King', 12.99, 4.8, 'Self-help, Personal Development', 'A guide to self-love and positivity that empowers readers to embrace their true selves.', 'In \"Good Vibes, Good Life,\" Vex King shares his personal journey and offers practical advice on cultivating self-love and positivity. The book emphasizes the importance of mindset and emotional well-being, providing readers with tools to unlock their potential and live their best lives.', , 1, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(6, 'Ace the Data Science Interview', 'Nick Singh', 29.99, 4.5, 'Technology, Career', 'A comprehensive guide to mastering data science interviews with real-world questions and answers.', '“Ace the Data Science Interview” equips candidates with essential strategies and insights for succeeding in data science interviews. The book covers various topics, including statistics, machine learning, and coding challenges, making it a valuable resource for aspiring data scientists.', , 0, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(7, 'Omniscient Reader', 'UMI(REDICE)', 8.99, 4.7, 'Manga, Fantasy', 'A unique story where the protagonist becomes aware that he is a character in a web novel.', '“Omniscient Reader\'s Viewpoint” follows the journey of a young man who discovers he is part of a story written in a web novel. The narrative is filled with twists, action, and character development, appealing to fans of fantasy and adventure.', , 0, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(8, 'Strange Pictures', 'Uketsu', 10.99, 4.6, 'Fiction, Mystery', 'A novel that intertwines art, mystery, and human emotions.', '“Strange Pictures” delves into the complexities of art and the human experience through a captivating narrative. The story explores themes of perception, identity, and the power of art to evoke deep emotions.', , 0, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(9, 'The Little Prince', 'Antoine de Saint-Exupéry', 9.99, 4.8, 'Fiction, Classic, Philosophy', 'A timeless tale of a young prince who travels to different planets, exploring themes of love, loss, and the essence of human relationships.', '\"The Little Prince\" is a profound and poetic story that reflects on the nature of human existence. Through the eyes of a young prince who visits various planets, the narrative delves into themes of innocence, friendship, and the importance of looking beyond the surface. Saint-Exupéry\'s enchanting storytelling and beautiful illustrations have made this beloved classic a cherished read for both children and adults alike.', , 1, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(10, 'Spy x Family, Vol. 1', 'Tatsuya Endo', 7.99, 4.9, 'Manga, Action', 'A hilarious and action-packed story of a spy who must build a family to complete his mission.', '“Spy x Family, Vol. 1” introduces Twilight, a spy tasked with infiltrating a prestigious school. To maintain his cover, he adopts a child and marries an assassin, resulting in a chaotic yet heartwarming family dynamic filled with humor and action.', , 1, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(11, 'Spy x Family, Vol. 2', 'Tatsuya Endo', 7.99, 4.9, 'Manga, Action', 'The second volume continues the thrilling adventures of the fake family, delving deeper into their secrets and challenges as they navigate their unusual lives together.', '\"Spy x Family, Vol. 2\" picks up where the first volume left off, as Twilight, Anya, and Yor continue to navigate the complexities of their covert lives. As they face new challenges and enemies, the dynamics of their relationships deepen, leading to both comedic and heartfelt moments. This volume explores more about Anya\'s school life and her interactions with her classmates, while Twilight undertakes more daring missions.', , 1, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(12, 'Spy x Family, Vol. 3', 'Tatsuya Endo', 7.99, 4.9, 'Manga, Action', 'The third volume escalates the action and humor as the family faces new challenges, uncovering more about each other\'s hidden talents and pasts.', '\"Spy x Family, Vol. 3\" continues the exciting saga of Twilight, Anya, and Yor as they encounter fresh challenges that test their abilities and bonds. As Twilight\'s mission intensifies, the family must come together to tackle unexpected threats while keeping their secrets hidden. Anya\'s telepathic abilities play a crucial role in navigating these new situations, leading to hilarious and dramatic moments.', , 1, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(13, 'Mission: Yozakura Family, Vol. 1', 'Hitsuji Gondaira', 9.99, 4.6, 'Manga, Action', 'The first volume introduces a young man who joins a secret family of assassins to protect his childhood friend, unveiling the dangers and adventures that lie ahead.', '\"Mission: Yozakura Family, Vol. 1\" follows the story of Taiyo, a young man who finds himself entangled with a secretive family of assassins known as the Yozakura. When his childhood friend is targeted, Taiyo decides to step into the dangerous world of espionage and assassination to protect her. This volume sets the stage for an exhilarating mix of action, intrigue, and emotional depth as Taiyo learns the ropes of his new life while uncovering dark secrets about the Yozakura family.', , 0, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(14, 'Mission: Yozakura Family, Vol. 2', 'Hitsuji Gondaira', 9.99, 4.7, 'Manga, Action', 'In the second volume, the plot thickens as Taiyo navigates new missions while trying to balance his feelings for his childhood friend amidst the chaos.', '\"Mission: Yozakura Family, Vol. 2\" continues the thrilling journey of Taiyo as he becomes more entrenched in the world of the Yozakura family. This volume explores the complexities of Taiyo\'s relationship with his childhood friend and the challenges they face together while dealing with new threats. As Taiyo undertakes more dangerous missions, he must also confront his growing feelings and the implications of their secret lives.', , 0, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(15, 'Sapiens: History of Humankind', 'Yuval Noah Harari', 19.99, 4.8, 'Non-fiction, History, Anthropology', 'A compelling exploration of the history of humankind, examining how Homo sapiens became the dominant species on Earth.', 'In \"Sapiens,\" Yuval Noah Harari takes readers on a fascinating journey through the history of humanity, from the emergence of Homo sapiens to modern civilization. He discusses key developments such as the Cognitive Revolution, the Agricultural Revolution, and the Scientific Revolution, exploring how these events shaped human societies and cultures. Harari’s thought-provoking insights challenge readers to consider the future of humanity and our place in the world.', , 1, 1);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(16, 'Harry Potter Paperback Box Set', 'J.K. Rowling', 100.00, 5.0, 'Fantasy, Young Adult, Fiction', 'The complete paperback collection of the Harry Potter series, following the journey of a young wizard and his friends through magical adventures and battles with dark forces.', 'This box set includes all seven books in J.K. Rowling’s epic Harry Potter series, from the first book \"Harry Potter and the Sorcerer\'s Stone\" to the final \"Harry Potter and the Deathly Hallows.\" It captures the entire journey of Harry Potter, as he discovers his magical heritage, makes friends, battles dark wizards, and faces his ultimate destiny. A perfect gift for both new readers and longtime fans.', , 1, 0);
INSERT INTO `book_info` (`id`, `name`, `author`, `price`, `rate`, `categories`, `short_description`, `long_description`, `image`, `is_best_seller`, `is_new_release`) VALUES
(17, 'The Kids in Mrs. Z\'s Class', 'Eliot Schrefer', 1.00, 2.0, 'Fiction', 'A heartwarming and funny children’s story about Wyatt Hill, whose best friend is an unusual class pet—a lizard.', 'In \"The Kids in Mrs. Z\'s Class: Wyatt Hill\'s Best Friend Is a Lizard,\" young Wyatt Hill navigates school life with his unusual best friend, a classroom lizard. This delightful tale by Eliot Schrefer captures the joys and challenges of friendships in childhood, with humor and heartwarming lessons about loyalty and acceptance. Perfect for early readers who love stories about animals and school adventures.', , 0, 1);

